            var deletedCount = await _repository.DeleteAll(); 
            
            var result = new List<DishEntity>();
            foreach(var item in _dishEntities)
            {
                var createdItem = await _repository.CreateAsync(item);
                result.Add( createdItem );
            }
            Console.WriteLine("Заполнение БД Блюд тестовыми данными END");
            return result;
        }

